import "./WelcomePirate.css";

const WelcomePirate = () => {
  return (
    <div id="welcomeDiv">
      <h1>Welcome Pirate!!</h1>
      <div id="innerDiv">
        <span>
          <img id="jack" src="/images/pic2.webp" />
        </span>

        <span id="span2">
          <h3>Meet Jack.</h3>
          Jack is a Gentleman Pirate.
          <br />
          He will guide you through your journey
        </span>
        <button className="piratebtn success">Let's Begin</button>
      </div>
    </div>
  );
};

export default WelcomePirate;
